import { createApp } from "vue";
import App from "./App.vue";
import Vue from "vue";
import Keycloak from "keycloak-js";

const keycloak = Keycloak({
  url: "https://keys.urfu.ru/auth/",
  realm: "urfu-lk",
  clientId: "rtf-eduload",
  public_key:
    "",
  "token-service":
    "https://keys.urfu.ru/auth/realms/urfu-lk/protocol/openid-connect",
  "account-service": "https://keys.urfu.ru/auth/realms/urfu-lk/account",
  "tokens-not-before": 0,
});

keycloak.init({
  onLoad: "check-sso",
});

createApp(App, {keycloak: keycloak}).mount("#app");
